import React from 'react';
import './Content.css';

const Part = ({ part, noOfExercises }) => (
  <p>
    {part}: <em>{noOfExercises}</em>
  </p>
);

const Content = (props) => {
  <>
    <Part part={props.part1} />
    <Part part={props.part2} />
    <Part part={props.part3} />
  </>;
};

export default Content;
